import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import { useState } from "react";

function Authentication() {
  // get user credential
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const handleSubmit = (event) => {
    event.preventDefault();

    setEmail("");
    setPassword("");
  };
  console.log(email);
  // Get acces token
  axios({
    method: "post",
    url: "authenticate?email=" + email + "&password=password123",
  }).then(function (response) {
    const Data = response.data;
    console.log("this is the responce: ", Data.access_token);
  });

  // change page with react-router-dom
  let navigate = useNavigate();
  const routeChange = () => {
    let path = `/Home`;
    navigate(path);
  };
  //   ends
  return (
    <div
      style={{ padding: "100px" }}
      className="d-flex flex-column align-items-center"
    >
      <h4 style={{ padding: "50px" }}>
        Please sign-in to your Rocket Elevators account.
      </h4>

      <Form onSubmit={handleSubmit}>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control
            type="email"
            placeholder="Enter email"
            onChange={(event) => setEmail(event.target.value)}
          />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" placeholder="Password" />
        </Form.Group>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
      <div>your email: {email}</div>
    </div>
  );
}

export default Authentication;
